  /** \u66F4\u65B0\u63A5\u53E3 */
  requestUpdateById?: (values) => Promise<any>;
  updateProps?: {
    /** \u6587\u672C */
    operateText?: string;
  };

  /** \u83B7\u53D6\u8BE6\u60C5\u63A5\u53E3 */
